INSERT INTO `notice` (`id`, `title`, `body`, `notice_date`, `t_id`) VALUES
(1, '2nd Dr. Ram Manohar Lohia Smarati lecture 2016', 'The student who is interested to attend the Dr. Ram Manohar Lohia Smarati lecture to hold on 27th August 2016 delivered by honorable Shri Rajnath Singh Minister GOI. Register online by SMS or University website.', '2016-07-10', 1),
(2, 'GUEST LECTURE on Role of Photography in Architecture', 'SCHOOL OF ARCHITECTURE GUEST LECTURE on Role of Photography in Architecture Date 9 th July 2016 Venue Madhulimaye Seminar Hall Time 11:30am - 3:30pm', '2016-07-06', 1),
(3, 'Collect Scholarship Cheques of OBC Category for 2015-16 Batch', 'aasdsndsbkdksjbkj,dskhbs,ios dlsod sodsld dljDKvdNLjdsbdkasbdkalkds\nsljsdnsalj'';D\nSKDHS''\nS''D[SBDSD\nS[ODLsdjuajda;dbspdls\njpoh''psa;dbskd\n[asiycnlsac[ [sdkc\n[s\n', '2016-07-29', 1),
(4, 'For viewing answer books of End Term Exam June 2016', 'It is informed that to all of these students of All Courses II IV VI & VIII Sem (Reg & Ex) who applied for viewing the end semester Answer Books of End Term Exam June 2016 They can contact in the office of undersigned on dated 27th to 28th June 2016 during 03:00 p.m. to 04:30 pm for viewing Answer Books Student are also advise they come with the question paper of relevant subject and books / notes', '2016-07-13', 1),
(5, 'Notice regarding Registration', 'This is to inform all the students of CSE and CA that classes will start from 1st July 2016. Student are required to pay their fee as shown on MIS and register themselves between 1- 4 July to avoid fine for late fee & registration. No registrations will be done without no dues certificate. Head-CSE/CA', '2016-07-27', 1),
(6, 'End-Term Exam June 2016 Time Table', 'All the Student here by inform that your End-Term Exam June 2016 Time Table is Live now, you can check at ITM University side More Links Exam Thanks Controller (Exams)', '2016-07-13', 1),
(7, 'Holiday', 'this is to inform all students due to diwali there will be holidays for 7 days from 27/08/2019 to 01/09/2020', '2016-02-08', 1);
